하 OOO 저거 진짜 기분 ㅈ같아요
예전에 제가 교회다닐때 나이 많이 차의나는 오빠가 있었는데 몇년전부터 알고있어서 친했거든요?
그오빠 이제 23인데 22살때 사촌동생집에서 놀려고 오빠한테 핸드폰 빌려달라해서 오빠거 빌려줬었는데 실수로 갤러리 들어가보니까 제가 페북이나 카톡의 올려놓은 제 얼사랑 제가 반바지입고 누워있을때 사진이 한 400장 정도 있는거에요;; 순간 정말 소름끼치더라구요;;
C8 그 오빠가 정신적으로 문제가 약간 있긴한테 5살 차의나는 제 사진으로 ㅈㅇ라든가 그런거 했었더라면;;
신고했어야 했는데 목사님께서 가만히 두라고 해서 OOO;; 작년 여름이야기인데 아직도 ㅈ같이 제 사진들이 기억나네요;;

진짜 생리 모르면 가만히좀;
사람들 따라 다르겠지만 생리할때 엄청 아픈사람들은
스트레스도 많이 받고 너무 아파서 움직이지도 못해요;

아직 중간고사 보지도 않았어요....
저 낼 모레 수현회 가고 간후 담주날 시험이라서 ;;
8,9일.... 시험이다 ... ....
